import "./App.css";
import React, { Component } from "react";
import env from "react-dotenv";

class App extends Component {
  state = {};

  componentDidMount = async () => {
    const url = env.API_URL;
    const key = env.API_KEY;
    const urlSearch =
      "/api/charities/v2/search?name=bike&fields=id,name,address,abstract&results=20&page=2";
    const myHeaders = new Headers();
    myHeaders.append("X-API-Key", "47TE87C-YYA4567-MSPD4RJ-NCRBF65");

    const requestOption = {
      method: "GET",
      headers: myHeaders,
    };

    const response = await fetch(urlSearch, requestOption);
    const data = await response.json();
    console.log(data);
  };

  render() {
    return <div>SEARCH</div>;
  }
}

export default App;
